import React from "react";
import { Link } from "react-router-dom";
import { TextField } from "@material-ui/core";

var navbarLogo = require('../assets/logo192.png')

const Home = () => {
    return (
      <nav>
        <div>
        <img src={navbarLogo} />
        </div>
        <div>
          <ul>
            <li>Home</li>
            <li>Services</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </div>
      </nav>
    )
  }

export default Home;
